import React from "react";
class ExampleComponent extends React.Component{
    sayHello(name){
        alert("Hi "+ name);
    }
    render(){
        return(
            <div>
                <button className="btn" onClick={()=>{
                    this.sayHello("asdf")
                }}>Click 1</button>
                <button onClick={this.sayHello("asdfa")}></button>
            </div>
        )
    }

}
export default ExampleComponent;
